package com.redhat.coolstore.model;

import java.io.Serializable;

import javax.persistence.Column;
import javax.persistence.Entity;
import javax.persistence.GeneratedValue;
import javax.persistence.GenerationType;
import javax.persistence.Id;
import javax.persistence.SequenceGenerator;
import javax.persistence.Table;

@Entity
@Table(name = "ORDER_ITEMS")
@SequenceGenerator(name = "orderItemSeq", sequenceName = "order_item_seq")
public class OrderItem implements Serializable {
    private static final long serialVersionUID = 64565445665456666L;

    @Id
    @Column(name="ID")
    @GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "orderItemSeq")
    private long id;

    private int quantity;

    private String productId;

    public OrderItem() {}

    public String getProductId() {
        return productId;
    }

    public void setProductId(String productId) {
        this.productId = productId;
    }

    public int getQuantity() {
        return quantity;
    }

    public void setQuantity(int quantity) {
        this.quantity = quantity;
    }

    @Override
    public String toString() {
        return "OrderItem [productId=" + productId + ", quantity=" + quantity + "]";
    }
}
```

## Additional Information

Note that we also updated the `@GeneratedValue` annotation to use `GenerationType.SEQUENCE` instead of relying on the default `AUTO` strategy. This is to ensure that the sequence generator is used to generate the ID.

Additionally, you may need to update your database schema to create the `order_item_seq` sequence. You can do this by running the `hbm2ddl` tool with the `hbm2ddl.auto=create` property set, as mentioned in the incident description. Alternatively, you can create the sequence manually using a SQL script.
